CREATE TABLE `terapia` (
  `idTerapia` int NOT NULL AUTO_INCREMENT,
  `Cliente_cliente_id` int NOT NULL,
  `Especialista_especialista_id` int NOT NULL,
  `Animal_animal_id` int DEFAULT NULL,
  `fecha_inicio` datetime(6) DEFAULT NULL,
  `fecha_fin` datetime(6) DEFAULT NULL,
  `estado` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `notas` varchar(255) COLLATE utf8mb4_general_ci DEFAULT 'Sin notas',
  `experiencia` varchar(255) COLLATE utf8mb4_general_ci DEFAULT 'Sin experiencia',
  PRIMARY KEY (`idTerapia`),
  KEY `fk_Terapia_Cliente1_idx` (`Cliente_cliente_id`),
  KEY `fk_Terapia_Animal1_idx` (`Animal_animal_id`),
  KEY `fk_Terapia_Especialista1_idx` (`Especialista_especialista_id`),
  CONSTRAINT `fk_Terapia_Animal1` FOREIGN KEY (`Animal_animal_id`) REFERENCES `animal` (`animal_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_Terapia_Cliente1` FOREIGN KEY (`Cliente_cliente_id`) REFERENCES `cliente` (`cliente_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_Terapia_Especialista1` FOREIGN KEY (`Especialista_especialista_id`) REFERENCES `especialista` (`especialista_id`) ON DELETE CASCADE ON UPDATE CASCADE
